import React from "react";
import {Table} from "antd";

function contest() {
    const style={
        width:800,
        height:500,
        background: 'rgba(189,234,202,0.55)',
        color:'#33548f',
        marginLeft:200,
        marginTop:200
    }
    return(
        <div>
            <input type="text" style={style}/>
            <Table/>
        </div>
    )
}
export default contest
